import { React } from "react";
import ReactDom from "react-dom";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

const PageLinks = () => {
  return (
    <ul>
      <li>
        <a href="/">Home</a>
        <a href="/page2">Page1</a>
        <a href="/page3">Page2</a>
      </li>
    </ul>
  );
};

const Homepage = () => {
  return "Homepage";
};

const Page2 = () => {
  return "Page 2 loaded";
};

const Page3 = () => {
  return "Page 3 loaded";
};

const App = () => {
  return (
    <Router>
      <Route path="*">
        <PageLinks />
      </Route>
      <Route exact path="/">
        <Homepage />
      </Route>
      <Route path="/page2">
        <Page2 />
      </Route>
      <Route path="/page3">
        <Page3 />
      </Route>
    </Router>
  );
};

ReactDom.render(<App />, document.getElementById("root"));
